(325, 'مشاهدة فيلم Cold Pursuit 2019 مترجم', 'مشاهدة وتحميل فيلم الاكشن والدراما Cold Pursuit 2019 بجودة HDCAM مترجم اون لاين وتحميل مباشر. نيلز (ليام نيسون) سائق كاشطات ثلج خلوق وملتزم، يُمنَح جائزة مواطن العام مِن قِبَل بلدة التزلج (كولورادو). لكن تتغير الأحوال وتنقلب حياته رأسًا على عقب بعد مقتل ابنه على يد رئيس منظمة إجرامية عتيدة الإجرام، فيصبح مسعى نيلز الوحيد هو الانتقام لولده', 'cold-pursuit-2019', 'https://m.media-amazon.com/images/M/MV5BM2YyYWI3NjItMWEwZS00MzhkLWJmZTMtZDAzYjRhODM0OTMzXkEyXkFqcGdeQXVyMjM4NTM5NDY@._V1_SX300.jpg', 6.5, 'HDCAM', 0, 1, 325, '2019-04-09 18:57:44', '2019-04-09 19:01:15'),
